        cursor: pointer;

    }

    input[type=radio] {
        padding: 2px;
        border: 1px solid $base-color;
    }



    .form-icon {
        position: absolute;
        z-index: 1000;
        margin: 10px;
    }




    input:focus,
    input:active,
    input:hover {
