.bookings {
    display: flex;
    justify-content: space-around;
    background: #E5E5E5;
    padding: 10px 50px;

    .booking-box {
        // width: 100%;
        margin: 20px;
        // background: #003CB0;

    }

    .booking-box div {
        position: relative;
        cursor: pointer;
        background: #FFFFFF;
        width: 120%;
        height: 200px auto;
        display: block;
        padding: 20px;
        border-radius: 10px;
        margin: 20px;
        box-shadow: 0px 3px 10px rgba(0, 0, 0, 0.06);

    }

    .booking-box div:nth-child(1) {
        height: 200px;
        margin-left: 30px;
        background: transparent;
        box-shadow: none;
    }

    .booking-ticket{
        position: relative;
        width: 700px;
        padding: 10px;
        height: 250px;
        margin: 80px 0px 0px 150px;

        .left{
            position: absolute;
            top: 120px;
            left: -10px;
            width: 40px;
            height: 40px;
            background: #E5E5E5;
            border-radius: 50%;
        }
        .right{
            position: absolute;
            top: 120px;
            right: -10px;
            width: 40px;
            height: 40px;
            background: #E5E5E5;
            border-radius: 50%;
        }

        .ticket-header{
            background: #fff;
            padding: 5px 20px;
            border-top-left-radius: 5px;
            border-top-right-radius: 5px;

            p{
                font-size: 24px;
                font-weight: lighter;
                color: #A3B5D0;
            }
            b{
                margin-top: -30px;
                float: right;
            }
        }

        .ticket-body{
            background: #fff;
            height: 200px ;
            padding: 20px 30px;
            border-top: 2px dashed #E5E5E5;
            border-bottom-left-radius: 5px;
            border-bottom-right-radius: 5px;
        }
    }

    .tabs {
        padding: 10px;
        display: inline-block;
        justify-content: space-around;
        margin: 20px 40px;
        position: relative;
        cursor: pointer;



        img {
            position: absolute;
            top: 10px;
            left: -40px;
        }

        p {
            font-size: 16px;
            font-weight: bold;
            color: $base-color;

        }

        span {
            color: #999;
            font-size: 14px;
            font-weight: bold;
        }

        hr {
            position: absolute;
            top: 72px;
            left: -40px;
            width: 200%;
            height: 1px;
            background: #999;
            margin: 0px !important;
        }

        .tabs:nth-child(3) hr{
            display: none;
            width: 100%;
        }

        hr.tab-active {
            top: 70px;
            left: -40px;
            height: 3px;
            background: $base-color;
        }

    }

    .tab-control{
        span{
            color: #999;
            font-size: 18px;
            font-weight: lighter;
        }

        p{
            color: $base-color;
            font-size: 16px;  
        }

        .tab-control-btn{
            margin: -70px 80px 0px 0px;
            float: right;
            border: 1px solid $base-color;
            transition: all 0.5s ease-out;
            padding: 5px 25px;
            height: 40px;
            border-radius: 30px;
            color: $base-color;

            img{
                float: right;
            }
        }

        .tab-control-btn:focus,.tab-control-btn:active,.tab-control-btn:hover{
            outline: none;
            background: $base-color;
            color: #fff;
            transition: all 0.5s ease-in;

            img{
                filter:  brightness(0) invert(1);
            }
        }

    }


}

.booking-header{
    color: #00DD80;
    font-weight: lighter;
    margin: 10px 0px;
}

.booking-text{
    color: #A3B5D0;
    font-size: 14px;
    margin: 10px 0px;
}

.booking-price{
    margin: -100px 0px 0px 0px;
    font-size: 24px;
    float: right;
}

.booking-time{
    position: relative;
    p{

        color: #677994;
        display: inline;
        font-weight: bold;
    }
    span{

        margin: 0px 50px;

    }
}

